import {Provider} from 'react-redux'
import initializeStore from '../redux/store'

export default function MyApp(props) {
    const {Component, pageProps} = props
    return (
        <Container>
            <Layout>
                <Provider store={initializeStore()}>
                    {/* 把pageProps解构后传递给组件 */}
                    <Component {...pageProps} />
                </Provider>
            </Layout>
        </Container>
    )
}
